Libros = new Mongo.Collection('libros');

Router.route('/', function () {
  this.render('layout', {
    data: function () { return Libros.find().fetch(); }
  });
});

Router.route('modal', {
  name: 'detalles',
  template: 'modal',
});

if (Meteor.isClient) {
  Template.modal.events = {
    "click .content.header" : function(e,t) {
      e.preventDefault();
      $(".ui.modal").modal("show");
    }
  };
}
